import './App.css';

import BlogCard from "./BlogCard";

function App() {
  const blogArr = [
    {
      id: 1,
      title: 'Blog Title 1',
      description: 'Yowwwwwwwwwww'
    },
    {
      id: 2,
      title: 'Blog Title 2',
      description: 'Yowwwwwwwwwww'
    },
    {
      id: 3,
      title: 'Blog Title 3',
      description: 'Yowwwwwwwwwww'
    }
  ]

  const blogCards = blogArr.map((item, pos) => {

    return (
      <BlogCard key={pos} title="{item.title}" description="{item.description} id={item.id}"/>
      // <div className="Blogcard" key={item.id}>
      //   <h3>{item.title}</h3>
      //   <p>{item.description}</p>
      //   </div>
    )
  })

  return (
  <div className="App">
    {blogCards}
    </div>
  );
}

export default App;
